import React from "react";
import { View, Text, D } from "react-native";

const { width } = Dimensions.get("window");


interface SlideProps {
    label: String;
    right?: boolean;
}

const Slide = ({ label, right}: SlideProps) => {
    return (
        <View style={{ width }}>
            <Text>{label}</Text>
        </View>
    );
};

export default Slide;
